import React from "react";
import NavBar from "./NavBar";
import "./Main.css";
import FadeIn from "react-fade-in";

function Main() {
  return (
    <div className="main">
      <div className="main__wrapper">
        <NavBar />
        <FadeIn>
          <div className="main__descritption">
            <div className="main__descritption-text">
              <a>
                Wir sind ein JUNGES, dynamisches Unternehmen das sich auf über
                20 JAHRE ERFAHRUNG im Bau- und Immobilienbereich stützt. Von der
                PROJEKTENTWICKELUNG, ANBAUTEN, AUSBAU oder UMGESTALTUNG von
                WOHN-, GESCHÄFTS-, BÜROHÄUSERN, bis hin zum NEUBAU.
                <br />
                <br />
                <br />
                WIR BAUEN – IHRE WÜNSCHE UND TRÄUME
              </a>
            </div>
          </div>
        </FadeIn>
      </div>
    </div>
  );
}

export default Main;
